import React from "react";

const MagnificientEqualButton = ({
	result,
	setResult,
	calculate,
	setCalculate,
}) => {
	const calculater = () => {
		try {
			setCalculate(eval(calculate));
		} catch (error) {
			setCalculate("Invalid format");
		}
	};
	const handleClick = (e) => {
		setResult(result.concat(e.target?.value));
	};

	return (
		<div className="MagnificientEqualButton">
			<button onClick={(calculater, handleClick)} value="=">
				=
			</button>
		</div>
	);
};

export default MagnificientEqualButton;
